import base64

def decode_base64_multiple_times(encoded_data, num_iterations):
    decoded_data = encoded_data

    for _ in range(num_iterations):
        try:
            decoded_data = base64.b64decode(decoded_data)
        except Exception as e:
            print(f"Error decoding base64: {e}")
            break

    return decoded_data

# Ejemplo de uso:
encoded_data = ""
num_iterations = 16  # NÃºmero de veces que deseas decodificar en base64

decoded_result = decode_base64_multiple_times(encoded_data, num_iterations)
print(decoded_result)